import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import '../components/TraineeProfile.css';

function TraineeProfile() {
  const { id } = useParams();
  const [trainee, setTrainee] = useState(null);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    fetch(`http://localhost:8000/trainees/${id}`)
      .then((res) => {
        if (!res.ok) throw new Error('Trainee not found');
        return res.json();
      })
      .then((data) => setTrainee(data))
      .catch((err) => setError(err.message));
  }, [id]);

  if (error) return (
    <div className="trainee-profile-container">
      <div className="trainee-card">
        <p style={{ color: 'red' }}>{error}</p>
        <button className="trainee-back-btn" onClick={() => navigate(-1)}>Back</button>
      </div>
    </div>
  );

  if (!trainee) return (
    <div className="trainee-profile-container">
      <div className="trainee-card">
        <p>Loading...</p>
      </div>
    </div>
  );

  return (
    <div className="trainee-profile-container">
      <div className="trainee-card">
        <h2>Trainee Profile</h2>
        <div className="trainee-card-info">
          <p><strong>ID:</strong> {trainee.id}</p>
          <p><strong>Name:</strong> {trainee.name || 'No name'}</p>
          <p><strong>Points:</strong> {trainee.points}</p>
          <p><strong>Streak:</strong> {trainee.streak}</p>
        </div>
        <button className="trainee-back-btn" onClick={() => navigate(-1)}>Back</button>
      </div>
    </div>
  );
}

export default TraineeProfile;
